preference.preference_description:
This preference is used to define Object properties for Grouping Report Data. Use internal names for object type and property. These properties will be available during Item Report Authoring in Active Workspace. User can select properties to create Charts. Values should be specified in below pattern:
ObjectType:{Property1,Property2}
Example:
ItemRevision:{release_status_list}
DocumentRevision:{DocumentTitle,DocumentAuthor,DocumentSubject}

This preference is used to define object types and properties. These values will be used in configuring table for Advance Summary Report in Active Workspace.For a object type, add a name of property which should be a part of Column Names list for a Table. Common properties are included from WorkspaceObject, so specify properties for individual object type here. Use internal name for the Object type and property name. Values should be specified in below pattern:
ObjectType:{property1,property2,property3}
e.g.
ItemRevision:{item_revision_id,item_id}

This preference is used to configure TcRA Report display for selected Business Objects. This Reports will be shown in seperate page named as 'Dashboard'. Stylesheet for the BO needs to be modified to inject a new page which can then render the TcRA Report viewer.
BOType:{Report1Information}
e.g.
Schedule:{"name":"Schdule object Dashboard", "type":"Report"}

This preference is used to configure TcRA Report display for application locations.TcRA Report will be displayed in TcRA Viewer. This Viewer will be inserted as a 'Dashboard' Sub-location. Pre-defined application location will only have this sub-location inserted.Values should follow below pattern:
LocationName:{Report1Information}
e.g.
Home:{"name":"Home Summary Overview", "type":"Report"}

This preference is used to configure TcRA Report display for the selected Business Object(BO) type.TcRA Report will be displayed in TcRA Viewer. This Viewer configuration needs to be injected into BO Stylesheet. Values should follow below pattern:
BOType:{Report1Information}
e.g.
ItemRevision:{"name":"BOM Report", "type":"Report"}

Defines the value and the format of the title for the Operation object. The format can consist of properties and special characters.
The properties will be surrounded by {} while the special characters will be displayed as is.
For example:  {bl_item_item_id}/{bl_rev_item_revision_id};{bl_rev_object_name}

Defines the value and the format of the title for the Process object. The format can consist of properties and special characters.
The properties will be surrounded by {} while the special characters will be displayed as is.
For example:  {bl_item_item_id}/{bl_rev_item_revision_id};{bl_rev_object_name}
